    <p>Se regirn por las siguientes clausulas:</p>
    <p class="texto-justificado"><b>1. EL ARRENDATARIO y/o USUARIO</b> de manera voluntaria y dando certeza de que todo lo que aqu consignado es cierto, por medio del presente documento declara que los recursos entregados provienen de la ocupacin profesin y oficio que desarrolla, los cuales no se enmarca dentro de ninguna actividad ilcita de las contempladas en el cdigo penal colombiano o en cualquier norma que lo modifique adicione o complemente.</p>
    <p class="texto-justificado"><b>2. EL ARRENDATARIO y/o USUARIO</b> declara y reconoce que recibe el vehculo especificado en este contrato en el estado de conservacin y funcionamiento de acuerdo con el acta de entrega o inventario.</p>
    <p class="texto-justificado"><b>3. CUSTODIA Y CUIDAO; EL ARRENDATARIO y/o USUARIO</b> Deber hacer entrega del vehculo en las mismas condiciones mecnicas y de conservacin en las que fue entregado. As como el tanque de combustible al mismo nivel como lo recibi. EL ARRENDATARIO deber sufragar el costo de cualquier gasto adicional en que incurra como chofer, combustible o cualquier otro gasto por el uso del automvil dado en alquiler se har responsable del vehculo por su custodia, cuidado, guardia material y jurdica, mientras permanezca en la tenencia del mismo, constituyndose en depositario oneroso y custodio del vehculo, asumiendo todas las responsabilidades civiles y penales que tal condicin implica, hasta tanto proceda a su devolucin a ARRENDADOR, para lo cual deber tomar las medidas necesarias de precaucin en la conduccin y cuidado del vehculo.</p>
    <p class="texto-justificado"><b>4. EL ARRENDATARIO y/o USUARIO</b> no podr sacar el vehculo del pas sin autorizacin escrita dada por EL ARRENDADOR.</p>
    <p class="texto-justificado"><b>5. EL ARRENDATARIO y/o USUARIO</b> debe cumplir con las obligaciones establecidas por las normas vigentes de trnsito y toda la normatividad que se relacione con el uso de vehculos, en caso de incumplimiento deber responder ante el proveedor y las respectivas autoridades por las infracciones de trnsito que se produzcan durante la vigencia del servicio del vehculo y que sean causadas por el ARRENDATARIO y/o conductor.</p>
    <p class="texto-justificado"><b>6. SUSCRIPCIN IRREVOCABLE: EL ARRENDATARIO   y/o USUARIO</b> autoriza de manera expresa e irrevocable a la arrendadora el congelamiento del cupo y/o venta no presencial con la tarjeta de crdito que relaciono, conforme a los trminos y condiciones del presente contrato PARAGRAFO: Por su seguridad se solicita el cdigo de seguridad de la tarjeta de crdito con el fin de poder realizar la transaccin autorizada mediante esta clusula.</p>
    <p class="texto-justificado"><b>7. DEBERES Y OBLIGACIONES: EL ARRENDATARIO   y/o USUARIO</b> tendr a su cargo las siguientes obligaciones y deberes derivadas del contrato de arrendamiento y a resarcir a ARRENDADOR los siguientes perjuicios que se llegase a causar durante la tenencia del vehculo: A) Por cualquier dao que se cause con el vehculo a la propiedad, bienes o vehculos de terceras personas; B) Por las lesiones fsicas que se causen con el vehculo a terceras personas; C) Responder contractual y extracontractualmente frente a terceros por los daos que se causen con el vehculo; D) Por los daos causados fsica y materialmente a personas y/o bienes transportados en el vehculo arrendado; E) Por las violaciones que cometa o le imputen haber cometido contra las normas de trnsito municipales, departamentales y/o nacionales durante el trmino del arrendamiento; F) Por el 100% del lucro cesante que deje de percibir ARRENDADOR y que vena percibiendo del valor del arrendamiento del vehculo, resultante de la imposibilidad fsica de poderlo dar en arrendamiento por parte de ARRENDADOR. G) Por el dao emergente resultante de la imposibilidad de ARRENDADOR de no poder volver a utilizar el vehculo en el caso de prdida total. H) Por el dao moral que se le llegase a causar tanto a ARRENDADOR como a terceras personas por la culpa, descuido y/o negligencia. I) A resarcir el valor de los daos causados al vehculo durante la vigencia del contrato cuando dicho valor supere los cuatro salarios mnimos mensuales legales vigentes (4 SMMLV).</p>
    <p class="texto-justificado"><b>8. RESPONSABILIDADES:</b> En el caso en que el vehculo arrendado sea detenido por las autoridades competentes por causas imputables al ARRENDATARIO, ste ser el nico responsable por el lucro cesante que se cause hasta la devolucin del mismo, valor que resultar de la liquidacin que se haga como si EL ARRENDATARIO hubiese utilizado el vehculo durante todo el tiempo que dure su recuperacin y cuyo valor ser el pactado en el presente contrato de arrendamiento. As mismo, EL ARRENDATARIO se responsabiliza de todas las consecuencias de carcter judicial, ya sea civil o penal, derivadas de la conducta desplegada por ste y en las que resulte involucrado el vehculo, con ocasin de la violacin de las normas vigentes que regulen cada una de estas materias y responder a ttulo personal por el hecho de cometer algn ilcito o infraccin de carcter civil y/o penal en el cual sea involucrado el vehculo. As mismo sern a cargo del ARRENDATARIO, los gastos por concepto de multas, servicio de gra, etc., al igual que el costo de las gestiones necesarias para lograr la devolucin del vehculo.</p>
    <p class="texto-justificado"><b>9. DEDUCIBLES:</b> EL ARRENDATARIO toma a su cargo el gasto adicional por seguro contra daos causados al vehculo objeto del arrendamiento, cualquiera que fuese la ndole del hecho: vuelco, despeamiento, incendio, hurto, inundacin, terremoto, choque simple, etc., con un deducible del 10% por robo o por accidente donde existan daos parciales o prdida total. El vehculo nicamente ingresar a los talleres asignados por la aseguradora y acceder a la pliza del seguro, previo peritazgo o cotizacin, cuando los gastos de las reparaciones superen el valor de 4 SMMLV; de lo contrario es EL ARRENDATARIO quien debe asumir dichos costos. Si el vehculo es de servicio pblico, el deducible ser del 20%. El pago no exime al ARRENDATARIO de asumir los gastos de recuperacin o reparacin del vehculo, en el caso de que los hechos sean imputables a su culpa y/o negligencia en la conduccin, cuidado y custodia del vehculo.</p>
    <p class="texto-justificado"><b>10. ACEPTACIN DE RESPONSABILIDAD ANTE INFRACCIONES DE TRNSITO POR MEDIOS ELECTRNICOS O FOTOMULTAS Y/O DAOS GENERADOS AL VEHCULO O CAMIONETA ANEXO AL CONTRATO AB-2031:</b> Por medio de la presente, yo, <b>{{$contratos->nombres}} {{$contratos->apellidos}}</b>, identificado con <b>{{$contratos->tipo_documento}} {{$contratos->numero_documento}} </b>, declaro que me hago responsable de todo tipo de infracin de transito y/o dao generado por m durante la tenencia del vehculo o camioneta que he recibido en alquiler por la empresa <b>RENT A CAR PASTO</b>. <br> Por lo tanto,autorizo a <b>RENT A CAR PASTO</b>, representada por alguno de sus funcionarios o persona a quien se delegue, a realizar los reportes respectivos a las autoridades competentes. De igual manera, autorizo para que se solicite informacin sobre infracciones de trnsito que posiblemente sean cometidas durante la vigencia del alquiler del vehculo.<br>Declaro igualmente, que asumo todos los gastos que se pudieran ocasionar con referencia a infracciones de transito y/o daos generados al vehiculo y/o camioneta.</p>
    <p class="texto-justificado"><b>11. GARANTA:</b> En caso de algn siniestro como hurto o accidente y como consecuencia de esto sea declarado por parte de la aseguradora a la cual se encuentra afiliado el vehculo como prdida total, EL ARRENDATARIO pagar a ARRENDADOR el 10% del valor comercial del vehculo  el 20% si el vehculo es de servicio pblico, para lo cual se tomar como base el precio establecido en la factura de venta del vehculo objeto de este contrato y adicionalmente el 100% del lucro cesante (stand-by) del vehculo, para lo cual EL ARRENDATARIO firma el ttulo valor LETRA DE CAMBIO Nro.	con carta de instrucciones, que es dejado en garanta por los daos que el vehculo pudiere llegar a sufrir o cualquier otra ndole como ya qued estipulado en las clusulas anteriores, durante el trmino del arrendamiento. Si por algn motivo EL ARRENDATARIO se llegase a negar al pago de los daos causados al vehculo o de alguno de los valores derivados del incumplimiento de cualquiera de las clusulas de este contrato durante el arrendamiento, este ttulo valor se llenar por las sumas de dinero resultante de las liquidaciones que se efecten de acuerdo al dao causado al vehculo por parte del ARRENDATARIO o derivados por la prdida total del mismo, el lucro cesante (stand-by), el dao emergente o cualquier otro concepto; sin dar derecho a reclamacin alguna por parte del ARRENDATARIO.
    <p class="texto-justificado" style="background-color:#fffb00";>Pargrafo:  As mismo, el depsito en garanta que EL ARRENDATARIO ha entregado a ARRENDADOR, bien sea en efectivo o en voucher de tarjeta de crdito, ser devuelto al ARRENDATARIO en un trmino de mximo 8 das hbiles posteriores a la entrega o devolucin del vehculo, una vez se verifique que no se hayan aplicado multas o comparendos electrnicos durante el trmino de la renta, u otros conceptos que se adeudaren.</p></p>
    <p class="texto-justificado"><b>12. CUBRIMIENTO DE DAOS:</b> Las reparaciones de los daos y/o averas que por cualquier circunstancia sufra el vehculo se harn nicamente en la forma y en los talleres que indique ARRENDADOR y para calcular el valor de los daos causados al vehculo, las partes se someten a una cotizacin o dictamen pericial por parte de un concesionario automotriz debidamente autorizado por los ensambladores de automviles en Colombia, y el vehculo slo ingresara a los talleres asignados por la aseguradora y acceder a la pliza del seguro si los gastos de las reparaciones superan el valor de cuatro salarios mnimos mensuales legales vigentes (4 SMMLV); de lo contrario ARRENDADOR determinar el taller adonde debe ingresar el vehculo para que le realicen las reparaciones y ser EL ARRENDATARIO quien asumir dichos costos. El tiempo que dure el vehculo en el taller mientras se realicen las reparaciones respectivas, bien sea das o semanas, ser cancelado por EL ARRENDATARIO como lucro cesante hasta el da que el vehculo sea recibido por ARRENDADOR; dicho valor ser liquidado de acuerdo a lo establecido Si el vehculo es de servicio pblico se incrementar dicho valor en un 20%. El pago no exime al ARRENDATARIO de asumir los gastos de recuperacin del vehculo en el caso de que los hechos sean imputables a su culpa y/o por negligencia en la conduccin, cuidado y custodia del vehculo.Lo anteriormente mencionado aplica nica y exclusivamente para novedades ocurridas dentro del territorio colombiano bajo el manejo de la persona incluida dentro del contrato como conductor principal o conductor secundario
</p>
    <p class="texto-justificado"><b>13. SANEAMIENTO:</b> Si por alguna circunstancia surgiera alguna reclamacin por parte de alguna autoridad, o de un tercero posteriormente de que el vehculo hubiese sido entregado y recibido por ARRENDADOR y ya se hubiese liquidado el contrato, EL ARRENDATARIO se obligar a responder y saldr al saneamiento ante dicha autoridad, ante terceros o ante ARRENDADOR segn sea el caso, por cualquier infraccin cometida durante el tiempo que lo tuvo bajo su responsabilidad.</p>
    <p class="texto-justificado"><b>14. MANEJO DE DATOS PERSONALES E INCUMPLIMIENTO:</b> El abajo firmante en su propio nombre o en nombre de la entidad que representa declara que la informacin suministrada es verdica y da consentimiento expreso al ARRENDADOR o a quien en un futuro haga sus veces como titular del servicio solicitado para, Realizar el tratamiento de sus datos personales y reportar el incumplimiento de este contrato reflejndose negativamente ante las centrales de riesgo segn el artculo 12 de la ley 1266 del 2008.</p>

    <p class="texto-justificado"><b>15. MERITO EJECUTIVO:</b> Las partes aqu contratantes manifiestan que este contrato presta merito ejecutivo en los trminos del articulo 488 del cdigo de procedimiento civil sin necesidad de requerimiento previo alguno.  el ARRENDATARIO autoriza a Rent a Car Pasto a realizar cobro no presencial en la tarjeta de crdito.</p>

